import Vue from 'vue';
import VueRouter from 'vue-router';

// Import your MainContent component
import MainContent from './components/MainContent.vue';

Vue.use(VueRouter);

const routes = [
  // Define your routes here
  {
    path: '/userpage',
    name: 'userpage',
    component: MainContent, // Use the MainContent component for the userpage route
  },
  // Add other routes if needed
];

const router = new VueRouter({
  routes,
  mode: 'history', // This uses HTML5 history mode for cleaner URLs
});

export default router;
